script: |
  super -f text -I q11530.spq | sort > q11530.out

inputs:
  - name: q11530.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NULL NOT BETWEEN + - ( + col2 ) / + col1 + col0 * - + col1 - + col0 AND + + col1 + - 83 - col2;
  - name: tab0

outputs:
  - name: q11530.out
    data: |
